document.addEventListener("turbolinks:load", function() {

    $input = $('*[data-behavior="autocomplete"]')

    var options = {
      url: function(phrase) {
        return "/search/index.json?q=" + phrase;
      },
      getValue: "name",
    };

    $input.easyAutocomplete(options);

  });
